import React from "react";
import './Home.css';

function ProductCart(props) {
	const { Product } = props;

	return (
		<div>
			<div id="cart_details">
				<img src={Product.src} alt='a' />
			</div>
			<div id="details_product">
				<h4 style={{ color: 'red' }}>{Product.package}</h4>
				<h4 style={{ color: 'red' }}>{Product.amount}</h4>
				<h4 style={{ color: 'red' }}>{Product.material}</h4>
				<h4 style={{ color: 'red' }}>{Product.Brand}</h4>
				<h4 style={{ color: 'red' }}>{Product.Dimensions}</h4>
			</div>
			<div>
				<button id="addtocart">Add To Cart</button>
			</div>
		</div>
	)
}
export default ProductCart
